import Layout from '../components/Layout';
import Link from 'next/link';

const PostLink = props => (
  <li>
    <Link href="/post/[author]/[quote]"
    as={`/post/${props.author}/${props.quote}`} >
      <a>{props.author}</a>
    </Link>
  </li>
);

export default function Index() {
  return (
    <Layout>
    <p>Hello </p>
    <ul>
        <PostLink author="dusty" quote="Quote 1 " />
        <PostLink author="sebastian" quote="Learn Next.js is awesome" />
        <PostLink author="billy" quote="Deploy apps with Zeit" />
      </ul>
  </Layout>
  );
}
